import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    resultIMC: {
        flex:1,
        marginTop:15,
        paddingTop:10,
        borderRadius:50,
        alignItems:"center",
        width:"100%",
    },
    numberIMC:{
        fontSize:48,
        color:"#FF0043",
        fontWeight:"bold",
    },
    information:{
        fontSize:18,
        color:"#FF0043",
        fontWeight:"bold",
    },
    boxShareButton:{
        width:"100%",
        alignItems:"center",
        marginBottom:10,
    },
    shared:{
        backgroundColor:"#1817f2",
        borderRadius:50,
        paddingBottom: 5,
        paddingTop: 5,
    },
    sharedText:{
        color:"#ffffff",
        fontWeight:"bold",
        paddingHorizontal:30,
    }
});

export default styles
